import React, { memo } from "react";
import IconSearchBar from "../../../../assets/svg/icon-search-bar";
import { HeaderCenterWrapper } from "./style";

const HeaderCenter = memo(() => {
  return (
    <HeaderCenterWrapper>
      <div className="search-bar">
        <div>搜索房源和体验</div>
        <div className="icon">
          <IconSearchBar/>
        </div>
      </div>
    </HeaderCenterWrapper>
  );
});

export default HeaderCenter;
